mapper.delete:

delete from kh_jsh
where JSHH = #{jshh,jdbcType=VARCHAR}
  and GDDWBM = #{gddwbm,jdbcType=VARCHAR}

mapper.select:

select JSHH, GDDWBM, KHBH, JSHMC, JSHDZ, JFFSDM, JFKH, FPDYFS, FPHQFS, DQYE, SDYE, 
YFXE, DQBM, CJSJ, CZSJ
from kh_jsh
where JSHH = #{jshh,jdbcType=VARCHAR}
  and GDDWBM = #{gddwbm,jdbcType=VARCHAR}
